// src/components/SeLoger.js
import React from "react";
import Section from "./Section";

const SeLoger = () => {
  return (
    <Section>
      <div className="max-w-6xl mx-auto px-4">
        {/* Flex container avec des marges gauche et droite et un espace entre les colonnes */}
        <div className="flex flex-col md:flex-row justify-between gap-8">
          {/* Chambres d'hôtes et Hôtels */}
          <div className="flex-1 text-center">
            <h3 className="text-xl font-semibold mb-4">Chambres d'hôtes et hôtels</h3>
            <ul className="space-y-4 text-sm">
              <li>
                <strong>La Ferme des Rousseaux, La Belliole</strong><br />
                +33 (0)3 86 88 74 93 – 600 m<br />
                <a href="http://www.booking.com/hotel/fr/ferme-les-rousseaux.fr.html" target="_blank" rel="noopener noreferrer" className="text-blue-600 underline">Lien Booking</a>
              </li>
              {/* Ajouter les autres éléments de la liste ici de la même manière */}
            </ul>
          </div>

          {/* Gîtes */}
          <div className="flex-1 text-center">
            <h3 className="text-xl font-semibold mb-4">Gîtes</h3>
            <ul className="space-y-4 text-sm">
              <li>
                <strong>Gîte du Hameau</strong><br />
                5 rue du hameau de Maurepas, 77940 Blennes – 10 km<br />
                +33 6 76 12 92 58<br />
                <a href="https://giteduhameau.wordpress.com" target="_blank" rel="noopener noreferrer" className="text-blue-600 underline">Site web</a>
              </li>
              {/* Ajouter les autres éléments de la liste ici de la même manière */}
            </ul>
          </div>
        </div>
      </div>
    </Section>
  );
};

export default SeLoger;
